import React from "react";

function Timeline() {
  return (
    <div>
      <div className="timeline-section">
        <h2 className="brief-title white-scrim">
          Timeline of Design Frontiers
        </h2>
        <Grid container>
          <Grid item sm={4}>
            <h2 className="brief-title">Brief</h2>
          </Grid>
        </Grid>
      </div>
    </div>
  );
}

export default Timeline;
